import { Route, Router } from "react-router-dom";
import { Fragment } from "react";
import Comments from "../components/comments/Comments";
const NewQute = () => {
  return (
    <Fragment>
      <h1>this is new qute page</h1>
      <Route path='/newqute/dd'>
        <Comments></Comments>
      </Route>
    </Fragment>
  );
};

export default NewQute;
